public boolean equals(Object o) {
  if (this.getClass() != o.getClass()) return false;
  HaversineFunction other = (HaversineFunction) o;
  return this.name().equals(other.name())
          && x1.equals(other.x1) &&
          y1.equals(other.y1) &&
          x2.equals(other.x2) &&
          y2.equals(other.y2);
}

